        webPopupImg.src = "data:image/jpeg;base64,";
        popup.appendChild(webPopupImg);

        let popupText = document.createElement('div');
        popupText.id = 'web-popup-text';
        popupText.innerHTML = 'This website created with WebGL provides an optimal experience on mobile devices.';
        popup.appendChild(popupText);

        // splash
        let splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);

