        progressBackground.id = 'progress-bar-container';
        progressBackground.src = "data:image/png;base64,";
        progressContainer.appendChild(progressBackground);

        let progressForeground = document.createElement('img');
        progressForeground.id = 'progress-bar';
        progressForeground.src = "data:image/png;base64,";
        progressContainer.appendChild(progressForeground);

