    let hideSplash = function () {
        let splash = document.getElementById('application-splash-wrapper');

        setTimeout(function(){
            splash.classList.add('hide');
        }, 500);
        
        setTimeout(function(){
            splash.parentElement.removeChild(splash);
        }, 1500);
    };

    let setProgress = function (value) {
        let bar = document.getElementById('progress-bar');
        let text = document.getElementById('progress-text');
        if(bar) {
            value = Math.min(1, Math.max(0, value));
            bar.style.clipPath = `polygon(0 0, ${value * 100}% 0, ${value * 100}% 100%, 0% 100%)`; 
            text.innerHTML = `<span>Counting ${Math.floor(value * 100)} sheeps...</span>`;
        }
    };

