            '    background-size: 512px;',
            '    background-image: url("data:image/jpeg;base64,");',
            '}',

            '#web-layer-popup {',
            '    position: absolute;',
            '    top: 0%;',
            '    left: 0%;',
            '    width: 100%;',
            '    height: 100%;',
            '    background-color: rgba(0,0,0,0.2);',
            '    z-index: 999;',
            '    visibility: hidden;',
            '    opacity: 0;',
            '    display: none;',
            '    transition: all 0.5s ease-in-out;',
            '}',

            '#web-layer-popup.show {',
            '    visibility: visible;',
            '    display: block;',
            '    opacity: 1;',
            '}',

            '#web-layer-popup.hide {',
            '    visibility: hidden;',
            '    opacity: 0;',
            '}',

            '#web-popup {',
            '    position: absolute;',
            '    top: 50%;',
            '    left: 50%;',
            '    padding: 50px;',
            '    border-radius: 20px;',
            '    background: #fff;',
            '    transform: translate(-50%, -50%);',
            '}',

            '#web-popup img {',
            '    display: block;',
            '    width: 250px;',
            '    margin: 0 auto;',
            '}',

            '#web-popup-text {',
            '    margin-top: 40px;',
            '    font-family: "kyobo_handwriting_2019regular";',
            '    font-weight: 700;',
            '    font-size: 24px;',
            '    letter-spacing: -1px;',
