            '}',

            '#title-image {',
            '    width: 100%;',
            '}',

            '@keyframes sprite {',
            '    from { background-position: 0px; }',
            '    to { background-position: -2925px; }',
            '}',

            '#sprite-anim-container {',
            '    position: relative;',
            '    width: 325px;',
